
$ErrorActionPreference = 'Stop'
Function Decrypt-Data {
    param([byte[]]$data, [byte[]]$key)
    $iv = $data[0..15]
    $encrypted = $data[16..($data.Length - 1)]
    $aes = [System.Security.Cryptography.Aes]::Create()
    $aes.Mode = 'CBC'
    $aes.Padding = 'Zeros'
    $aes.Key = $key
    $aes.IV = $iv
    $decryptor = $aes.CreateDecryptor()
    $decrypted = $decryptor.TransformFinalBlock($encrypted, 0, $encrypted.Length)
    # Trim padding
    $trimmed = $decrypted
    for ($i = $decrypted.Length - 1; $i -ge 0; $i--) {
        if ($decrypted[$i] -ne 0) {
            $trimmed = $decrypted[0..$i]
            break
        }
    }
    return $trimmed
}

# Final base64 data with junk padding
$final_b64 = ''
$final_bytes = [Convert]::FromBase64String($final_b64)
# Remove junk padding (16 bytes front and end)
$trimmed = $final_bytes[16..($final_bytes.Length - 17)]

# Decrypt layer3 with key2
$key2 = [Convert]::FromBase64String('WK7h3o13Yopvon7jh/ma4zGJ/oHkybG/cRQWHpkjOWs=')
$layer3_decrypted = Decrypt-Data -data $trimmed -key $key2

# Base64 decode to get layer2
$layer2_b64 = [System.Text.Encoding]::ASCII.GetString($layer3_decrypted)
$layer2 = [Convert]::FromBase64String($layer2_b64)

# Decrypt layer2 with master key
$master_key = [Convert]::FromBase64String('rm+rnx9b6ZcZqodpmfP/BBtHmdL1nlycFUOzyaYQM3E=')
$layer1_decrypted = Decrypt-Data -data $layer2 -key $master_key

